script: |
  super -f text -I q11334.spq | sort > q11334.out

inputs:
  - name: q11334.spq
    data: |
      SELECT + col0 FROM tab1 (FORMAT parquet) WHERE + col1 * - col2 / + col2 NOT IN ( + ( + - col2 ) / CAST ( + col2 AS INTEGER ) ) OR NOT - 21 + col1 IS NULL;
  - name: tab1

outputs:
  - name: q11334.out
    data: |
      51
      85
      91
